import React from 'react' 

const style = {
    section: {
        backgroundColor: "rgba(2, 245, 8, .5)",
        borderRadius: "20px",
        color: "#fff",
        padding: "20px",
        marginTop: "30px"
    },

    ol: {
        margin: 0,
        padding: 0
    }
}

export default function MyHeroes() {
    return(
        <div style={style.section}>
            <h2>IU and Saffro are going to sing. With them are:</h2>
            <ol style={style.ol}>
                <li>Beatriche</li>
                <li>Carolina</li>
                <li>Juliana</li>
            </ol>
        </div>
    )
}
